package com.worktree.hrms.config;

import com.worktree.hrms.entity.UserEntity;
import com.worktree.hrms.utils.HibernateUtils;
import jakarta.annotation.PostConstruct;
import org.hibernate.Session;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.context.annotation.Configuration;

@Configuration
public class TestConfig {

    @Autowired
    private HibernateUtils hibernateUtils;

    @PostConstruct
    public void init(){



        UserEntity sri = getUserEntity("sri");

        if(sri==null){
            sri = new UserEntity();
        }


        UserEntity chandu = getUserEntity("chandu");
        if(chandu==null){
            chandu = new UserEntity();
        }

        UserEntity admin = getUserEntity("admin");
        if(admin==null){
            admin = new UserEntity();
        }

        sri.setUserName("sri");
        sri.setPassword("sri");
        sri.setProfilePic("");
        sri.setDisplayName("Sri Harsha Gangavelli");

        hibernateUtils.saveOrUpdateEntity(sri);



        admin.setUserName("admin");
        admin.setPassword("admin");
        admin.setProfilePic("");
        admin.setDisplayName("Administrator");
        admin.setAdmin(true);

        hibernateUtils.saveOrUpdateEntity(admin);

        chandu.setUserName("chandu");
        chandu.setPassword("chandu");
        chandu.setProfilePic("");
        chandu.setDisplayName("Chandra Sheker Gunthaku");

        hibernateUtils.saveOrUpdateEntity(chandu);
    }

    private UserEntity getUserEntity(String userName) {
        try(Session session = hibernateUtils.getSession()){
            return (UserEntity) session.createQuery("FROM UserEntity WHERE userName=:userName").setParameter("userName",userName).uniqueResult();
        }
    }

}
